import * as types from "./../Constant/ActionTypes";

var initialState = [username];

const register = (state = initialState, action) => {
  switch (action.type) {
    case types.REGISTER:
      console.log(action.info);
      return [...state];
    default:
      return [...state];
  }
};
export default register;
